import React, { useState } from 'react';
import Grid from '@material-ui/core/Grid';
import DateFnsUtils from '@date-io/date-fns';
import {
    MuiPickersUtilsProvider,
    KeyboardDatePicker,
    KeyboardTimePicker,
} from '@material-ui/pickers';

export default function DatePickerExample() {
    const [selectedDate, setSelectedDate] = useState(new Date());

    function handleDateChange(date) {
        setSelectedDate(date);
    }
    return (
        <MuiPickersUtilsProvider 
            utils={DateFnsUtils} 
        >
            <Grid 
                container 
            >
                <Grid 
                    item 
                    xs={4}
                >
                    <KeyboardDatePicker 
                        variant='inline' 
                        margin='normal' 
                        value={selectedDate} 
                        onChange={handleDateChange} 
                        format='MM/dd/yyyy'
                        id='date-picker-inline'
                        KeyboardButtonProps={{
                            'aria-label': 'change date',
                        }}
                        label='Inline Date Picker'
                    />
                </Grid>
                <Grid 
                    item 
                    xs={4}
                >
                    <KeyboardDatePicker 
                        margin='normal'
                        value={selectedDate}
                        onChange={handleDateChange}
                        label='Birthday'
                        format='MM/dd/yyyy'
                        id='date-picker-normal'
                        KeyboardButtonProps={{
                            'aria-label': 'change date',
                        }}
                    />
                </Grid>
                <Grid 
                    item
                    xs={4} 
                >
                    <KeyboardTimePicker 
                        margin='normal'
                        value={selectedDate} 
                        onChange={handleDateChange}
                        label='Time Picker'
                        KeyboardButtonProps={{
                            'aria-label': 'change time',
                        }}
                        id='input-time-picker'
                    />
                </Grid>
            </Grid>
        </MuiPickersUtilsProvider>
    );
}
